import { Link } from "react-router-dom";

const Main = () => {
    return (
        <div>
            <h1>메인화면</h1>
            <Link to="/boardlist"> 게시판이동</Link><br />
            <Link to="/board/1"> 게시물</Link>
        </div>)
    ;
}

export default Main;
